import React from "react";
import s from "./Header.module.css"
import icon from "../../vk.png";
import {NavLink} from "react-router-dom";
const Header =(props)=>{

    return(

        <div className={s.header}>
            <img src={icon} alt="network"/>

            {props.isAuth?<div><NavLink to={"/profile/10867"}><span>{ props.login}</span></NavLink> <button onClick={props.logout} >logout</button> </div> : <NavLink to={"/login"}><span> "no logined"</span></NavLink>}

        </div>
    )
}
export default Header;
